import React from "react";
import { foodTypes } from '../../Data/Data'
import classes from './Foods.module.css';
import { Link } from 'react-router-dom';

const Foods = () => {

    return (

        <section id="foods" className={classes.container}>

            <div className={classes.wrapper}>

                <h4 className={classes.subtitle}>What we offer</h4>
                <h2 className={classes.title}>Best meals in the city</h2>
                  <div className=""></div>
                {foodTypes.map((foodTypes) => (

                    <Link to={`/foods/${foodTypes}`} key={foodTypes.id} className={classes.food}>

                        <h4>{foodTypes.name}</h4>

                        <div className={classes.imgContainer}>
                            <img src={foodTypes.img} />

                        </div>
                    </Link>

                ))}

            </div>


        </section>

    )
}
export default Foods
